import { CHANGE_NAME } from '../actions/index'
const initialState = {
    newName: '1'
}
export default function reducer(state = initialState, action) {
    switch (action.type) {
        case CHANGE_NAME:
            return {
                ...state,
                newName: action.payload.newName
            }
        default:
            return state
    }
}
